import { useState } from "react"

const Stats = () => {
    const [statsData, setStatsData] = useState()
    useEffect(()=>{
        fetch('http://localhost:7000/data').then(
            (response) => {
                return response.json()
            }
        ).then((data)=>{
            console.log(data);
        setStatsData(data);
        })
    },[])

    return(
        <div>
            <h1>Stats</h1>
            <h3>Stats Model</h3>
        </div>
    )
}
export default Stats;
